CREATE VIEW [dbo].[LtLimitView]
AS
SELECT     dbo.LtLimit.LimitId, dbo.LtValue.ValueId, dbo.LtValue.ValueName, dbo.LtValue.Description, dbo.TkUnit.UnitName, dbo.TkPost.Post, dbo.LtLimit.UpperValidityLimit, 
                      dbo.LtLimit.LowerValidityLimit, dbo.LtLimit.UpperSQCLimit, dbo.LtLimit.LowerSQCLimit, dbo.LtLimit.UpperReleaseLimit, dbo.LtLimit.LowerReleaseLimit, 
                      dbo.LtLimit.Target, dbo.LtLimit.StandardDeviation, dbo.LtValue.ValidationProcedure, dbo.LtLimit.RecipeParameterName, 
                      dbo.TkWriteLocation.ServerName AS WriteLocation, dbo.LtLimit.OPCUpperItemId, dbo.LtLimit.OPCLowerItemId, dbo.Lookup.LookupName AS LimitType, 
                      Lookup_1.LookupName AS LimitSource
FROM         dbo.LtValue INNER JOIN
                      dbo.TkUnit ON dbo.LtValue.UnitId = dbo.TkUnit.UnitId INNER JOIN
                      dbo.TkPost ON dbo.TkUnit.PostId = dbo.TkPost.PostId INNER JOIN
                      dbo.LtLimit ON dbo.LtValue.ValueId = dbo.LtLimit.ValueId INNER JOIN
                      dbo.Lookup ON dbo.LtLimit.LimitTypeId = dbo.Lookup.LookupId INNER JOIN
                      dbo.Lookup AS Lookup_1 ON dbo.LtLimit.LimitSourceId = Lookup_1.LookupId LEFT OUTER JOIN
                      dbo.TkWriteLocation ON dbo.LtLimit.OPCWriteLocationId = dbo.TkWriteLocation.WriteLocationId
WHERE     (dbo.Lookup.LookupTypeCode = 'RtLimitType') AND (Lookup_1.LookupTypeCode = 'RtLimitSource')
GO
