                      LtValue_1.ValueId AS TriggerValueId, TkUnit_1.UnitName AS TriggerUnitName, dbo.LtDerivedValue.Callback, dbo.TkWriteLocation.ServerName AS ResultServerName, 
                      dbo.LtDerivedValue.ResultItemId, dbo.LtDerivedValue.SampleTimeTolerance, dbo.LtDerivedValue.NewSampleWaitTime, dbo.LtHistory.RawValue AS TriggerRawValue, 
                      dbo.LtHistory.SampleTime AS TriggerSampleTime, dbo.LtHistory.ReportTime AS TriggerReportTime
