CREATE VIEW [dbo].[DtFinalDiagnosisView]
AS
SELECT     dbo.DtApplication.ApplicationName, dbo.DtFamily.FamilyName, dbo.DtFamily.FamilyPriority, dbo.DtFinalDiagnosis.FinalDiagnosisName, 
                      dbo.DtFinalDiagnosis.FinalDiagnosisPriority, dbo.DtFinalDiagnosis.CalculationMethod, dbo.DtFinalDiagnosis.PostTextRecommendation, 
                      dbo.DtFinalDiagnosis.TextRecommendationCallback, dbo.DtFinalDiagnosis.RefreshRate, dbo.DtFinalDiagnosis.TextRecommendation, dbo.DtFinalDiagnosis.Active, 
                      dbo.DtFinalDiagnosis.Explanation, dbo.DtFinalDiagnosis.TrapInsignificantRecommendations, dbo.DtFinalDiagnosis.LastRecommendationTime, 
                      dbo.DtFinalDiagnosis.TimeOfMostRecentRecommendationImplementation
FROM         dbo.DtApplication INNER JOIN
                      dbo.DtFamily ON dbo.DtApplication.ApplicationId = dbo.DtFamily.ApplicationId INNER JOIN
                      dbo.DtFinalDiagnosis ON dbo.DtFamily.FamilyId = dbo.DtFinalDiagnosis.FamilyId
GO
